import React, { useState } from "react";
import { Collapse } from "antd";
const { Panel } = Collapse;

function RadioBox() {
  return (
    <div>
      <Collapse defaultActiveKey={["1"]}>
        <Panel header="Price" key="1"></Panel>
      </Collapse>
    </div>
  );
}

export default RadioBox;
